let state = {
  posts: [
    { id: 1, message: "Hi, how are you", likesCount: 12 },
    { id: 2, message: "It's my first post", likesCount: 11 },
  ],
  dialogs: [
    { id: 1, name: "Vadick" },
    { id: 2, name: "Alina" },
    { id: 3, name: "Chesterok" },
    { id: 4, name: "Puppy" },
    { id: 5, name: "Another Puppy" },
    { id: 6, name: "Another cat" },
  ],
  messages: [
    { id: 1, message: "Hi" },
    { id: 2, message: "Mew Mew" },
    { id: 3, message: "Bark Bark" },
  ],
};

export default state;
